import React from 'react';

const LoggingContactCard = () => {
  const contactInfo = {
    companyName: "The Clean Logging Company",
    tagline: "Professional Forest Management & Timber Services",
    phone: "(555) 123-4567",
    emergency: "(555) 999-8888",
    email: "info@cleanlogging.com",
    location: "456 Forest Road, Woodland, OR 97123",
    hours: "Mon-Fri: 6:00 AM - 5:00 PM",
    services: [
      "Commercial Logging",
      "Land Clearing",
      "Forest Management",
      "Emergency Tree Removal"
    ]
  };

  return (
    <div className="max-w-2xl w-full bg-white rounded-lg shadow-lg overflow-hidden border-t-4 border-green-700">
      {/* Header Section */}
      <div className="bg-green-50 p-6 space-y-2">
        <h2 className="text-3xl font-bold text-green-900">{contactInfo.companyName}</h2>
        <p className="text-green-700 font-medium">{contactInfo.tagline}</p>
      </div>

      {/* Main Contact Information */}
      <div className="p-6 grid grid-cols-1 md:grid-cols-2 gap-6">
        {/* Left Column - Contact Details */}
        <div className="space-y-4">
          <h3 className="text-lg font-semibold text-green-800 mb-3">Contact Us</h3>

          {/* Phone Numbers */}
          <div className="space-y-2">
            <div className="flex items-center space-x-3">
              <span className="text-green-700 font-bold">📞</span>
              <div>
                <a href={`tel:${contactInfo.phone}`} 
                   className="text-green-700 hover:text-green-900 font-medium">
                  {contactInfo.phone}
                </a>
                <p className="text-sm text-gray-600">Main Office</p>
              </div>
            </div>

            <div className="flex items-center space-x-3">
              <span className="text-red-600 font-bold">🚨</span>
              <div>
                <a href={`tel:${contactInfo.emergency}`} 
                   className="text-red-600 hover:text-red-700 font-medium">
                  {contactInfo.emergency}
                </a>
                <p className="text-sm text-gray-600">24/7 Emergency</p>
              </div>
            </div>
          </div>

          {/* Email */}
          <div className="flex items-center space-x-3">
            <span className="text-green-700 font-bold">✉</span>
            <a href={`mailto:${contactInfo.email}`} 
               className="text-green-700 hover:text-green-900">
              {contactInfo.email}
            </a>
          </div>

          {/* Location */}
          <div className="flex items-center space-x-3">
            <span className="text-green-700 font-bold">📍</span>
            <span className="text-gray-700">{contactInfo.location}</span>
          </div>

          {/* Hours */}
          <div className="flex items-center space-x-3">
            <span className="text-green-700 font-bold">🕒</span>
            <span className="text-gray-700">{contactInfo.hours}</span>
          </div>
        </div>

        {/* Right Column - Services */}
        <div>
          <h3 className="text-lg font-semibold text-green-800 mb-3">Our Services</h3>
          <ul className="space-y-2">
            {contactInfo.services.map((service, index) => (
              <li key={index} className="flex items-center space-x-2">
                <span className="text-green-700">🌲</span>
                <span className="text-gray-700">{service}</span>
              </li>
            ))}
          </ul>

          {/* Call to Action */}
          <div className="mt-6 bg-green-50 p-4 rounded-lg">
            <p className="text-green-800 font-medium">Need emergency tree removal?</p>
            <p className="text-sm text-green-600">Available 24/7 for urgent situations</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default LoggingContactCard;
